CREATE TABLE pigeon(
   Pos      INTEGER  NOT NULL PRIMARY KEY 
  ,Breeder  VARCHAR(23) NOT NULL
  ,Pigeon   VARCHAR(15) NOT NULL
  ,Name     VARCHAR(14)
  ,Color    VARCHAR(4) NOT NULL
  ,Sex      VARCHAR(1) NOT NULL
  ,Ent      INTEGER  NOT NULL
  ,Arrival  VARCHAR(7) NOT NULL
  ,Speed    NUMERIC(7,3) NOT NULL
  ,To_Win   VARCHAR(7) NOT NULL
  ,Eligible VARCHAR(3) NOT NULL
);
